    "2. 단일 평면 플루오로스코프: 단방향 관점은 강한 광도 측면을 말합니다. 빛의 어두운면을 볼 수 없습니다. 즉, 실내 조명이 실외보다 강할 때, 밖의 사람들은 안에서 사람들을 볼 수 있습니다. 일반적으로 외부 사람들은 낮에는 내부 사람들을 볼 수 없습니다.",
