  "description": [
    "제품 소개",
    "제품 장점:",
    "(1) 부드럽고 편안하며 통기성이 좋고 정전기 방지.",
    "(2) 손쉬운 세척, 퇴색없이 세탁기 또는 손으로 직접 씻을 수 있습니다.",
    "(3) 친환경 인쇄 및 염색, 냄새 없음, 유해 물질 없음.",
    "(4) 내구성 및 내구성, 좋은 미끄럼 저항, 보호 바닥.",
    "(5) 카펫의 가장자리는 품질과 긴 수명을 보장하기 위해 신중하게 재봉됩니다.",
    "일반적인 문제:",
    "(1) 포장 문제로 인해 카펫에 중력이 1 ~ 2 일 동안 사용되는 한 카펫에 약간의 주름이있을 수 있습니다.",
    "주름을 사라지거나 잠시 동안 주름을 사용하여 자동으로 사라질 수 있습니다.",
    "(2) 다른 디스플레이 설정으로 인해 실제 제품은 실제 개체에 따라 약간의 색상 차이가있을 수 있습니다. 양해 해 주셔서 감사합니다!",
    "(3) 1 -2cm 크기의 오차를 허용하십시오, 이해해 주셔서 감사합니다!",
    "우리가 빨리 배송하기 때문에 1 또는 2 점의 낮은 점수를 제공하지 마십시오. 그러나 해외 배송은 많은 요인에 따라 다릅니다. 이해해 주셔서 감사합니다!",
    "우리는 진심으로 당신이 우리에게 좋은 평가를 줄 수 있기를 바랍니다. 우리는 제품과 서비스의 품질을 향상시키기 위해 최선을 다할 것입니다. 질문이 있으시면 저희와 채팅을 하시거나 온라인 메시지를 남겨주시면 제품 및 서비스에 만족할 때까지 문제를 해결해 드리겠습니다."
  ]
