    "고시:",
    "1. 색수차 정보",
    "제품 사진은 전문 사진 작가가 촬영하며 약간의 색수차가있을 수 있습니다. 이것은 제품 품질 문제가 아닙니다. 실제 제품을 참조하십시오.",
    "2. 주름 정보",
    "일부 국가의 배송 제한으로 인해 일부 카펫을 접고 포장해야하며, 품질 문제가 아닌 주름이있을 수 있습니다. 시간이 지남에 따라 주름이 사라지고 다림질로도 해결할 수 있습니다. 당신이 이해하기를 바랍니다.",
