    "드롭 배송 지원. 우리는 당신의 고객에게 상품을 직접 보낼 수 있고 당신이 원한다면 우리에 대한 정보를 남기지 않을 것입니다.",
    "주문 보호 시간이 곧 끝날 경우 당사에 문의하십시오. 보호 시간을 연장하도록 도와 드릴 수 있습니다. 따라서 귀하의 돈은 내 계좌에 입금되지 않습니다.",
    "당신이받을 때 품목에 만족하지 않는 경우에 첫째로 저희에게 연락하십시오, 우리는 당신의 의견이나 분쟁을 떠나기 전에 당신에게 만족스러운 해결책을 제안 할 것입니다, 당신의 친절한 이해에 감사드립니다!",
    "매장에서 팔로우를 클릭하십시오. 상점 활동을 잃지 않습니다. 많은 쿠폰과 다양한 프로모션을 받기 위해 매장의 추종자가됩니다. 제품을 구입하고 매장에서 무료 선물을받을 수있는 기회를 얻으십시오!",
